argument-count-test (block: class harness-block)
S1: symbol = the symbol argument-count-test;
S2: symbol = the symbol dummy-procedure-3;
N1,N2: integer;
P1,P2: class procedure;
begin
P1 = the procedure named by S1;
P2 = the procedure named by S2;
N1 = number-of-arguments-for-procedure(P1);
N2 = number-of-arguments-for-procedure(P2);
if (N1 = 1) and (N2 = 3) then
begin
call report(block, the symbol PASSED, "");
end else begin
call report(block, the symbol FAILED, "Wrong number of arguments, expected (1,3), got ([N1],[N2])");
end;
end

memory-usage-test(block: class harness-block)
S1: symbol = the symbol dummy-procedure;
N1, mem1, mem2: integer;
P1: class procedure;
struct1, struct2: structure;
begin
P1 = the procedure named by S1;
struct1 = the value of the value-structure of reg1-mem;
mem1 = the data-point-value of struct1;
N1 = number-of-arguments-for-procedure(P1);
struct2 = the value of the value-structure of reg1-mem;
mem2 = the data-point-value of struct2; 
if (N1 = 0) and (mem2 <= mem1) then
begin
call report(block, the symbol PASSED, "");
end else begin
call report(block, the symbol FAILED, "Memory leaked");
end;
end
